import React, { useState } from 'react';
import PoliceAddForm from './PoliceAddForm';
import PoliceSearchForm from './PoliceSearchForm';

const PoliceTabs = ({ token }) => {
  const [activeTab, setActiveTab] = useState('add');

  return (
    <div>
      <div className="flex mb-4">
        <button
          onClick={() => setActiveTab('add')}
          className={`mr-4 px-4 py-2 ${activeTab === 'add' ? 'bg-blue-500 text-white' : 'bg-gray-300'}`}
        >
          Agregar
        </button>
        <button
          onClick={() => setActiveTab('search')}
          className={`px-4 py-2 ${activeTab === 'search' ? 'bg-blue-500 text-white' : 'bg-gray-300'}`}
        >
          Buscar
        </button>
      </div>
      {activeTab === 'add' ? (
        <PoliceAddForm token={token} />
      ) : (
        <PoliceSearchForm token={token} />
      )}
    </div>
  );
};

export default PoliceTabs;
